MathJax.Localization.addTranslation("es","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax utiliza tipos de letra web para mostrar la notaci\xF3n matem\xE1tica de esta p\xE1gina. Estos tardan un poco en descargarse, por lo que instalarlos en el equipo acelerar\xE1 la renderizaci\xF3n de la p\xE1gina.",imageFonts:"MathJax est\xE1 utilizando sus fuentes de imagen en lugar de las fuentes locales o basadas en web. Esto renderizar\xE1 m\xE1s lento que de costumbre, y las matem\xE1ticas no podr\xE1n imprimir a la resoluci\xF3n completa de la impresora.",noFonts:"MathJax es incapaz de encontrar una fuente para mostrar sus matem\xE1ticas y las fuentes de imagen no est\xE1n disponibles, as\xED que usar\xE1 caracteres Unicode gen\xE9ricos con la esperanza de que el navegador ser\xE1 capaz de mostrarlas. Es posible que algunos caracteres no se muestren correctamente, o no en absoluto.",webFonts:"La mayor\xEDa de los navegadores modernos permiten fuentes para ser descargadas a trav\xE9s de la web. Actualizar a una versi\xF3n m\xE1s reciente de tu navegador (o cambiar de navegador) podr\xEDa mejorar la calidad de las matem\xE1ticas en esta p\xE1gina.",fonts:"MathJax puede utilizar las [fuentes STIX](%1) o las [fuentes TeX MathJax](%2). Descarga e instala una de esas fuentes para mejorar tu experiencia en MathJax.",STIXPage:"Esta p\xE1gina est\xE1 dise\xF1ada para usar las [fuentes STIX](%1). Descarga e instala esas fuentes para mejorar tu experiencia en MathJax.",TeXPage:"Esta p\xE1gina est\xE1 dise\xF1ada para usar las [fuentes MathJax TeX](%1). Descarga e instala esas fuentes para mejorar tu experiencia en MathJax."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/es/FontWarnings.js");
